UPDATE FloorMaps
SET image = CASE
    WHEN name = 'Floor 1' THEN 'data:image/jpeg;base64,'
    WHEN name = 'Floor 2' THEN 'data:image/png;base64,'
    WHEN name = 'Floor 3' THEN 'data:image/jpeg;base64,'
    WHEN name = 'Floor 4' THEN 'data:image/jpeg;base64,'
    WHEN name = 'Floor 5' THEN 'data:image/jpeg;base64,'
END
WHERE name IN ('Floor 1', 'Floor 2', 'Floor 3', 'Floor 4', 'Floor 5');